@369cyberpunk Indeed, will be interesting to see how things play out

One thing is that people can take a loan out now and if the price of hedron goes down after selling they can cover the loan for less USD$

I think this will make hedron dips get bought up violently as the protocol matures

@askconradzen Looks alright to me -- Hedron allows collateralization of HEX stakes which is a beautiful thing and the yields are not accessible till end of stake

Personally I think the ability to collateralize is necessary for any project going into the future

What am I missing?

@llamamarket @HedronCrypto It's funny, I have a stake ending the moment hedron becomes claimable xD

Will I be able to claim hedron for that stake or be able to restake and claim some hedron?

Ty!
